import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import { Typography, Link, Box } from "@material-ui/core";
import Navbar from "./Navbar";

const useStyles = makeStyles(theme => ({
    mainContainer: {
        background: "",
        padding: "2rem",
        color: "white"
    },

    timeline: {
        position: "center",
        padding: "2rem",
        margin: "0 auto",
        "&:before": {
            content: "''",
            position: "absolute",
            border: "1px solid tan",
            right: "40px",
            top: 0
        },
        "&after": {
            content: "''",
            display: "table",
            clear: "both"
        }
        // [theme.breakpoint.up("md")]: {
        //     padding: "2rem",
        //     "&:before": {
        //         left: "calc(50%- 1px)",
        //     right: "auto"    
        //     }
        // }
    }
}))

    const Contact = () => {
        const classes = useStyles();
        return (
            <>
                <Navbar />
                <Box component="header" className={classes.mainContainer}>
                    <Typography variant="h4" align="center">
                        <b> Do you want to collaborate? Looking for a freelancer?  </b>
                    </Typography>
                    <>
                    </>
                    <Box component="div" className={classes.timeline}>
                        <Typography variant="h4" align="center">
                            Sent an email to:
                            &nbsp; 
                            <u> 
                            <b>mnc634@utexas.edu</b>
                            </u>
                        </Typography>
                    <Box component="header" className={classes.mainContainer}>
                            <Typography variant="h4" align="center">
                                <b>
                                Or:
                                </b> 
                            </Typography>
                        </Box>
                        <Box component="header" className={classes.mainContainer}>
                            <Typography variant="h4" align="center" color="white">
                                <p>Visit my </p>
                                    <Link href="https://www.linkedin.com/in/mario-nicol%C3%A1s-castro-villarreal-78169335/" color="primary">
                                    <li><u>LinkedIn</u></li>
                                </Link>
                                &nbsp;
                                    <Link href="https://github.com/mncastro" color="primary">
                                    <li><u>Github Profile</u></li>
                                    </Link>
                            </Typography>
                    </Box>
                </Box>
                </Box>
            </>
        )
    }

    export default Contact
